    """
    TLE : Dijkstra algorithm implementation. Dijkstra doesn't inherently need any memory to save the distances because each distance is attached to element in the queue itself and can be used to update the values of it's surrounding nodes or make any similar decisions.
    But there is no point in adding the nodes which did not get their values shortened to the queue because they will not make any changes to their next nodes but will take processing time if added. Therefore in order to calculate the change in value we have to use dp array.
    Alternately we can also use use 0-K BFS/Dial's Algo which is exactly this implementation. but it is of no use for the same reason.
    """
    def minimumObstacles(self, grid) -> int:
        rows, cols = len(grid), len(grid[0])
        queue = [(0, (0, 0))]
        visited = [[False for _ in range(cols)] for _ in range(rows)]

        # ones = 0
        # for i in range(rows):
        #     for j in range(cols):
        #         if grid[i][j] == 1:
        #             ones+=1
        #
        # if ones == (rows*cols - 2):
        #     return rows + cols - 1 - 2
        # elif ones == 0:
        #     return 0
        # elif rows == 1 or cols == 1:
        #     return ones

        while queue:
            obstacle_count, (i, j) = heapq.heappop(queue)
            if i == rows - 1 and j == cols - 1:
                return obstacle_count
            # update the values of all surrounding elements in dp.
            moves = [(-1, 0), (0, -1), (1, 0), (0, 1)]
            for dr, dc in moves:
                next_row, next_col = i + dr, j + dc
                if 0 <= next_row < rows and 0 <= next_col < cols and not visited[next_row][next_col]:
                    heapq.heappush(queue, (obstacle_count + grid[next_row][next_col], (next_row, next_col)))
            visited[i][j] = True

        return -1

